import React, { Component } from 'react';

class Item extends Component{
    render(){
        const { songInList, song } = this.props;
        const { id, name } = songInList;
        const artists = songInList.ar ||songInList.artists
        return(
            <li key={id}>
                {console.log(artists)}
            </li>
        )
    }
}
export default Item;
